import React from 'react';
import logo from './images/logo.svg';

function Nav() {
    return (
        <header className="navbar">
            <nav className="nav">
                <ul>
                    <img src={logo} />
                    <li>멋쟁이 제작자</li>
                    <li>먹방 & 레시피</li>
                    <li>건강한 이야기</li>
                </ul>
            </nav>
        </header>
    );
}

export default Nav;
